import React from 'react';
import '../../App.css';
import Tracks from '../Tracks';
import HomeSection from '../HomeSection';
import Footer from '../Footer';
import NavBar from '../Navbar';

function Trackss() {
  return (
    <>
      <NavBar />
      <Tracks />
      <Footer />
    </>
  );
}

export default Tracks;
